import ReactDOM from 'react-dom'
import Home from './Home';
import NavBar from './NavBar';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <NavBar />
      </header>
      <body class="bg-dark">
      </body>
    </div>
  );
}

export default App;
